import React, { Component } from 'react';

class Items extends Component {
    render(props) { 

        if (this.props.battle || !this.props.items) {
            return (
                <div>BATTLE!</div>
            )
        }

        let cards = this.props.items;
        return ( 
            {cards}
         );
    }
}

export default Items;
